import React, { useState, useEffect } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Typography,
  CircularProgress,
  Alert,
  Box,
  Chip,
  Avatar,
  Card,
  CardContent,
} from '@mui/material';
import { styled } from '@mui/material/styles';

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
  '&:last-child td, &:last-child th': {
    border: 0,
  },
}));

interface PilotStatusData {
  id: number;
  userId: number;
  firstName: string;
  lastName: string;
  cpf: string;
  email: string;
  cellphone: string;
  status: string;
}

interface ApiResponse {
  success: boolean;
  count: number;
  data: PilotStatusData[];
}

export const StatusList = () => {
  const [pilots, setPilots] = useState<PilotStatusData[]>([]);
  const [loading, setLoading] = useState<boolean>(true);
  const [error, setError] = useState<string | null>(null);
  const [count, setCount] = useState<number>(0);

  useEffect(() => {
    const fetchAuthorizedPilots = async () => {
      try {
        setLoading(true);
        setError(null);

        // Substitua pela URL base da sua API
        const apiUrl = 'http://localhost:3000/status-list'; // Ajuste conforme necessário

        const response = await fetch(apiUrl, {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
            // Adicione headers de autenticação se necessário, ex:
            // 'Authorization': `Bearer ${localStorage.getItem('token')}`,
          },
        });

        if (!response.ok) {
          throw new Error(`Erro HTTP! Status: ${response.status}`);
        }

        const result: ApiResponse = await response.json();

        if (result.success) {
          setPilots(result.data);
          setCount(result.count);
        } else {
          throw new Error(result.error || 'Falha na requisição');
        }
      } catch (err) {
        setError(err instanceof Error ? err.message : 'Erro desconhecido ao buscar pilotos');
      } finally {
        setLoading(false);
      }
    };

    fetchAuthorizedPilots();
  }, []);

  const getStatusColor = (status: string) => {
    switch (status.toLowerCase()) {
      case 'ativo':
        return 'success';
      case 'inativo':
        return 'default';
      default:
        return 'warning';
    }
  };

  const getStatusLabel = (status: string) => {
    switch (status.toLowerCase()) {
      case 'ativo':
        return 'Ativo';
      case 'inativo':
        return 'Inativo';
      default:
        return status;
    }
  };

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="400px">
        <CircularProgress />
        <Typography variant="h6" sx={{ ml: 2 }}>
          Carregando pilotos...
        </Typography>
      </Box>
    );
  }

  if (error) {
    return (
      <Alert severity="error" sx={{ mb: 2 }}>
        {error}
      </Alert>
    );
  }

  return (
    <Box sx={{ p: 3 }}>
      <Card>
        <CardContent>
          <Typography variant="h4" component="h1" gutterBottom>
            Lista de Pilotos Autorizados
          </Typography>
          <Typography variant="body1" color="text.secondary" gutterBottom>
            Total de pilotos ativos: {count}
          </Typography>

          {pilots.length === 0 ? (
            <Alert severity="info">
              Nenhum piloto autorizado encontrado.
            </Alert>
          ) : (
            <TableContainer component={Paper} sx={{ mt: 3 }}>
              <Table aria-label="tabela de pilotos autorizados">
                <TableHead>
                  <TableRow>
                    <TableCell>Foto</TableCell>
                    <TableCell>Nome Completo</TableCell>
                    <TableCell>CPF</TableCell>
                    <TableCell>Email</TableCell>
                    <TableCell>Celular</TableCell>
                    <TableCell>Status</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {pilots.map((pilot) => (
                    <StyledTableRow key={pilot.id}>
                      <TableCell>
                        <Avatar sx={{ bgcolor: 'primary.main' }}>
                          {pilot.firstName.charAt(0)}{pilot.lastName.charAt(0)}
                        </Avatar>
                      </TableCell>
                      <TableCell>
                        {pilot.firstName} {pilot.lastName}
                      </TableCell>
                      <TableCell>{pilot.cpf}</TableCell>
                      <TableCell>{pilot.email}</TableCell>
                      <TableCell>{pilot.cellphone}</TableCell>
                      <TableCell>
                        <Chip
                          label={getStatusLabel(pilot.status)}
                          color={getStatusColor(pilot.status)}
                          size="small"
                        />
                      </TableCell>
                    </StyledTableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          )}
        </CardContent>
      </Card>
    </Box>
  );
};
